개요 Java 애플리케이션에서 관계형 데이터베이스를 쉽게 다룰 수 있게 해주는 표준 API. ORM(Object-Relational Mapping)을 통해 객체와 데이터베이스 테이블을 매핑. 주요 특징 ORM 지원 : 객체와 데이터베이스 테이블을 자동으로 매핑. SQL을 직접 작성하지 않아도 데이터베이스 연동 가능. 데이터베이스 독립성 : JPA 인터페이스 사용하여 특정 데이터베이스에 종속되지 않음. 트랜잭션 관리 : 트랜잭션 처리를 간편하게 관리할 수 있는 기능 제공. JPQL (Java Persistence Query Language) : 객체지향 쿼리 언어 사용하여 데이터베이스 질의 가능. 사용 예시 import javax.persistence.*; @Entity
public class User { @Id @GeneratedValue private Long id; private String name; private String email; // getters and setters
} EntityManagerFactory emf = Persistence.createEntityManagerFactory("example-unit");
EntityManager em = emf.createEntityManager(); em.getTransaction().begin();
User user = new User();
user.setName("John Doe");
user.setEmail("john@example.com");
em.persist(user);
em.getTransaction().commit(); em.close();
emf.close();
